    private $curl;


    private function curl_get($url, $headers = [])
    {
        curl_setopt($this->curl, CURLOPT_POST, false);

        array_push($headers, $this->auth_h, $this->version_h);
        curl_setopt($this->curl, CURLOPT_HTTPHEADER, $headers);
        curl_setopt($this->curl, CURLOPT_URL, $url);

        return curl_exec($this->curl);
    }
    private function curl_post($url, $data = [], $headers = [])
    {
        array_push($headers, $this->auth_h, $this->version_h);

        // $post_data = http_build_query($data);
        curl_setopt($this->curl, CURLOPT_POST, true);
        curl_setopt($this->curl, CURLOPT_POSTFIELDS, $data);
        curl_setopt($this->curl, CURLOPT_HTTPHEADER, $headers);
        curl_setopt($this->curl, CURLOPT_URL, $url);
        return curl_exec($this->curl);
    }

    function __construct($key)
    {
        $this->key = $key;
        $this->auth_h = 'Authorization: Bearer ' . $this->key;

        $this->curl = curl_init();

        // curl settings ===============
        // return result as a string instead of put it to response
        curl_setopt($this->curl, CURLOPT_RETURNTRANSFER, 1);
        // save error information to stderr
        curl_setopt($this->curl, CURLOPT_VERBOSE, 1);
    }

    function db_get_info($id)
    {
        return $this->curl_get('https://api.notion.com/v1/databases/' . $id, []);
    }
    function db_get_info_arr($id)
    {
        return json_decode($this->db_get_items($id));
    }

    function db_get_items($id, $options = [])
    {
        return $this->curl_post('https://api.notion.com/v1/databases/' . $id . '/query', $options);
    }
    function db_get_items_arr($id, $options = [])
    {
        return json_decode($this->db_get_items($id, $options));
    }

    function page_create_in_db($parent, $name, $icon_emoji = "")
    {
        $data = [
            "parent" => [
                "database_id" => $parent
            ],
            "properties" => [
                "Name" => [
                    "title" => [
                        [
                            "text" => [
                                "content" => $name
                            ]
                        ]
                    ],
                ],
            ]
        ];
        
        if ($icon_emoji != "")
        $data["icon"] = [
            "type" => "emoji",
            "emoji" => $icon_emoji
        ];

        $headers = ['Content-Type: application/json'];

        return $this->curl_post('https://api.notion.com/v1/pages', json_encode($data), $headers);
    }
